import { getTickets } from "../../utils/api-client"
import { receiveTickets } from "./tickets"
// import { setAuthedToken } from "./authToken"

export function handleDashboardData() {
  return async (dispatch) => {
    const data = await getTickets()
    dispatch(receiveTickets(data))
  }
}
